export const addCategory = (cate) => {
    return { type: "ADD_CATEGORY", payload: cate }
}
export const loadCategory = (myData) => {
    return { type: "SET_CATEGORY", payload: myData }

}

export const deleteCategory=(id)=>{
    return{type:"REMOVE_CATEGORY",payload:id}
}
